contracts/SmartContractLessons/Events.so.content:
//SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

/** event allow you to write data on a blockchain,this data cannot really be retrieved by a smartContract */

contract Event {
    event Log(string message, uint256 val);
    event IndexedLog(address indexed sender, uint256 val);

    function example() external {
        emit Log("foo", 123);
        emit IndexedLog(msg.sender, 700);
    }

    event Message(address indexed _from, address indexed _to, string message);
    function sendMessage(address _to, string calldata message) external {
        emit Message(msg.sender,_to,message);
    }
}

